import React from 'react';
import { View, Text, StyleSheet, Image } from 'react-native';

const ImageDetail = ({ title, link}) => {
    return (
        <View>
            <Text>{title}</Text>
            <Image source={link} />
        </View>
    );
}

const styles = () => StyleSheet.create({})

export default ImageDetail;
